oxy_webhelp_navlinks = {"sh_adv.dita-d4800e5471":{"topics":[{"title":"Object linking and embedding","shortdesc":"<p class=\"shortdesc\">Object Linking and Embedding (OLE) is a technology that lets you share data between applications and is supported for Microsoft™ Windows™.<\/p>","href":"sh_object_link_embed_r.html","attributes":{"data-id":"sh_object_link_embed_r"},"menu":{"hasChildren":true},"tocID":"sh_object_link_embed_r-d4800e5482","next":"sh_object_link_embed_r-d4800e5482"},{"title":"What is OLE 2.0?","shortdesc":"<p class=\"shortdesc\">Put your short description here; used for first paragraph and abstract.<\/p>","href":"sh_object_link_ole_defined_c.html","attributes":{"data-id":"sh_object_link_ole_defined_c"},"menu":{"hasChildren":false},"tocID":"sh_object_link_ole_defined_c-d4800e5714","topics":[]},{"title":"What is OCX?","shortdesc":"<p class=\"shortdesc\">Put your short description here; used for first paragraph and abstract.<\/p>","href":"sh_object_link_ocx_defined_c.html","attributes":{"data-id":"sh_object_link_ocx_defined_c"},"menu":{"hasChildren":false},"tocID":"sh_object_link_ocx_defined_c-d4800e5725","topics":[]},{"title":"Troubleshooting tips for embedding OLE objects and ActiveX controls","shortdesc":"<p class=\"shortdesc\">There are several reasons you may see the message: An error has occurred while processing a request on an object.<\/p>","href":"sh_trblshoot_oleobj_activex_r.html","attributes":{"data-id":"N10001"},"menu":{"hasChildren":false},"tocID":"N10001-d4800e5736","topics":[]},{"title":"How can I export documents in a view into structured text files?","shortdesc":"<p class=\"shortdesc\">Structured text is ASCII text. Exporting from an HCL Notes® view to structured text creates a file containing the text of the documents, minus any rich-text attributes, as well as all data in document fields.<\/p>","href":"sh_export_doc_to_structedfile_t.html","attributes":{"data-id":"sh_export_doc_to_structedfile_t"},"menu":{"hasChildren":false},"tocID":"sh_export_doc_to_structedfile_t-d4800e5747","topics":[]},{"title":"How can I export view data into tabular text files?","shortdesc":"<p class=\"shortdesc\">Tabular text is ASCII text arranged in rows and columns, separated by tabs. When you export a view to a tabular text file, each row in the HCL Notes® view becomes a text row (line). Each column in the view becomes a text column, separated by space characters. The contents of the Notes fields shown in the view become the entries in each column.<\/p>","href":"sh_export_doc_to_tabularfile_t.html","attributes":{"data-id":"sh_export_doc_to_tabularfile_t"},"menu":{"hasChildren":false},"tocID":"sh_export_doc_to_tabularfile_t-d4800e5761","topics":[]},{"title":"How can I export view data in CSV files?","shortdesc":"<p class=\"shortdesc\">You can export HCL Notes® view data to a CSV file. The Comma Separated Value (CSV) file format is a simple ASCII text file with one record per line, whose fields are separated by commas.  The documents in the view will appear as individual records in the CSV file.<\/p>","href":"sh_export_doc_to_csv_t.html","attributes":{"data-id":"sh_export_doc_to_csv_t"},"menu":{"hasChildren":false},"tocID":"sh_export_doc_to_csv_t-d4800e5778","topics":[]},{"title":"How can I import structured text files?","shortdesc":"<p class=\"shortdesc\">Structured text is ASCII text that is structured in fields that contain values. When importing structured text into a view, you must select an HCL Notes® form to accept the data. <\/p>","href":"sh_import_structed_text_to_view_t.html","attributes":{"data-id":"sh_import_structed_text_to_view_t"},"menu":{"hasChildren":false},"tocID":"sh_import_structed_text_to_view_t-d4800e5792","topics":[]},{"title":"How can I import tabular text files?","shortdesc":"<p class=\"shortdesc\">Tabular text is ASCII text arranged in rows and columns, separated by tabs. When you import a tabular text file into a view, each text row becomes an individual document, and each text column becomes a field. The original table cell contents become field contents.<\/p>","href":"sh_import_tabulartext_to_view_t.html","attributes":{"data-id":"sh_import_tabulartext_to_view_t"},"menu":{"hasChildren":false},"tocID":"sh_import_tabulartext_to_view_t-d4800e5806","topics":[]},{"title":"How can I modify an OLE object or ActiveX custom control using Notes® properties?","shortdesc":"<p class=\"shortdesc\">With HCL Notes® properties, you can modify an embedded OLE object or ActiveX custom control to make it more useful to you. For example, by editing the Width property, you could widen an Excel spreadsheet to display more information on your screen.<\/p>","href":"sh_modify_oleobj_activex_t.html","attributes":{"data-id":"sh_modify_oleobj_activex_t"},"menu":{"hasChildren":false},"tocID":"sh_modify_oleobj_activex_t-d4800e5817","topics":[]}]}};